import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { AreaChart, Area, XAxis, YAxis, Tooltip, ResponsiveContainer, CartesianGrid } from 'recharts';
import './Dashboard.css';

const formatarValor = (valor) => `R$ ${parseFloat(valor || 0).toLocaleString('pt-BR', { minimumFractionDigits: 2, maximumFractionDigits: 2 })}`;

const ResumoCard = ({ titulo, valor, cor, formatador = formatarValor }) => (
    <div className="resumo-card-dashboard">
        <h3>{titulo}</h3>
        <p className={cor}>{formatador(valor)}</p>
    </div>
);

function Dashboard() {
    const [summary, setSummary] = useState(null);
    const [loading, setLoading] = useState(true);

    useEffect(() => {
        const fetchSummary = async () => {
            try {
                const token = localStorage.getItem('token');
                if (!token) {
                    setLoading(false);
                    return;
                }
                const authHeaders = { headers: { Authorization: `Bearer ${token}` } };
                const { data } = await axios.get("http://localhost:5000/api/dashboard/summary", authHeaders);
                setSummary(data);
            } catch (error) {
                console.error("Erro ao carregar o resumo do dashboard:", error);
            } finally {
                setLoading(false);
            }
        };
        fetchSummary();
    }, []);

    const formatadorTooltip = (value) => `R$ ${value.toLocaleString('pt-BR', { minimumFractionDigits: 2, maximumFractionDigits: 2 })}`;
    const formatadorYAxis = (tick) => `R$ ${Math.round(tick / 1000)}k`;

    if (loading) {
        return <div className="dashboard-container">Carregando...</div>;
    }

    if (!summary) {
        return <div className="dashboard-container">Não foi possível carregar os dados do dashboard.</div>;
    }

    return (
        <div className="dashboard-container">
            <h2>Dashboard</h2>

            <div className="resumo-grid-dashboard">
                <ResumoCard 
                    titulo="Patrimônio Líquido" 
                    valor={summary.patrimonioLiquido} 
                    cor={summary.patrimonioLiquido >= 0 ? 'patrimonio-positivo' : 'patrimonio-negativo'}
                />
                <ResumoCard titulo="Patrimônio Cripto" valor={summary.saldoCripto} />
                <ResumoCard titulo="Outros Ativos" valor={summary.saldoOutrosAtivos} />
                <ResumoCard titulo="Ordens Ativas" valor={summary.ordensAtivas} formatador={(v) => v} />
            </div>

            <div className="grafico-box-dashboard">
                <h3>Evolução do Patrimônio (Últimos 30 dias)</h3>
                <ResponsiveContainer width="100%" height={400}>
                    <AreaChart data={summary.historicoPatrimonio} margin={{ top: 10, right: 30, left: 20, bottom: 0 }}>
                        <defs>
                            <linearGradient id="colorPatrimonio" x1="0" y1="0" x2="0" y2="1">
                                <stop offset="5%" stopColor="#007bff" stopOpacity={0.8}/>
                                <stop offset="95%" stopColor="#007bff" stopOpacity={0}/>
                            </linearGradient>
                        </defs>
                        <CartesianGrid strokeDasharray="3 3" stroke="#333" />
                        <XAxis dataKey="data" stroke="#888" />
                        <YAxis stroke="#888" tickFormatter={formatadorYAxis} />
                        <Tooltip
                            formatter={formatadorTooltip}
                            contentStyle={{ backgroundColor: '#2a2a2a', border: '1px solid #444' }}
                            labelStyle={{ color: '#fff' }}
                        />
                        <Area type="monotone" dataKey="patrimonio" stroke="#007bff" fillOpacity={1} fill="url(#colorPatrimonio)" />
                    </AreaChart>
                </ResponsiveContainer>
            </div>
        </div>
    );
}

export default Dashboard;
